];

export default {
  name: "Search",
  components: { SearchField },
  data() {
    return {
      searchQuery: "",
      searchResults: null,
      showSearch: false
    };
  },
  computed: {
    searchHistory() {
      return this.$store.state.edukasi.searchHistory;
    }
  },
  methods: {
    updateSearchQuery(searchQuery) {
      this.searchQuery = searchQuery;
    },
    searchEdukasi() {
      const edukasiMaterialList = EDUKASI_MATERIAL_LIST;

      this.showSearch = true;

      this.searchResults = edukasiMaterialList.filter(edukasi =>
        edukasi.title.toLowerCase().includes(this.searchQuery.toLowerCase())
      );

      if (this.searchQuery && !this.searchHistory.includes(this.searchQuery))
        this.$store.commit("edukasi/addToSearchHistory", this.searchQuery);
    },
    clearInput() {
      this.searchQuery = "";
      this.showSearch = false;
      this.searchResults = null;
    },
    removeSearchHistory(idx) {
      this.$store.commit("edukasi/removeSearchHistoryAt", idx);
    }
  }
};
</script>

